        <tr><td><img class="icon" src="img/pfp_isabel.png"></td><td><pfp><oso>Calliope Quill</oso></pfp> <dtime>May 1, 2016 2:55 PM</dtime><br>As you may have noticed by now, I am pretty intolerant of "AUs", but there is a very rational and sound reason behind this behavior. The reason is, we all love Undertale!<br>Why would people create entirely new universes which are not only unoriginal, but also completely abolish the meaning and depth of the canon characters as well?<br>The only kind of "AUs" I would perhaps tolerate are the ones that find their source directly from the canon, but diverge from it only because of a "what if" scenario. And in Undertale, the only ones I could think of right now is "What if Gaster's incident never occurred?", or "What if the humans did not attack Asriel and Chara when they arrived in the village?", for example.<br>But since we don't know anything whatsoever about either Gaster and his incident's whereabouts or about the surface anyway, such fanfiction could never come even close to canon, which makes it pointless and utterly ridiculous either way.</td></tr>
