        <tr><td><img class="icon" src="img/pfp_joss.png"></td><td><pfp><gso>Yoshua</gso></pfp> <dtime>May 1, 2016 2:56 PM</dtime><br>And no matter how hard you try Calliope, your fanfics are never going to be canon either<br>So it's literally the pot calling the kettle black <img class="emoji" src="http://learnwhentoquit/emj/flowey_troll.png"></td></tr>
        <tr><td><img class="icon" src="img/pfp_isabel.png"></td><td><pfp><oso>Calliope Quill</oso></pfp> <dtime>May 1, 2016 2:56 PM</dtime><br>Maybe, but you don't need to recreate the whole universe just for that! Why do you see yourself as an Undertale fan if what you're writing has nothing to do with the game? Just write an original story then, not a fanfiction that will most likely disrespect the original content.</td></tr>
